INSERT INTO `SCENE` VALUES (1,1,'Sente-se.','http://191.232.161.50:8080/mapskills/images/scene01.jpg',1,NULL),(2,2,'Me diga! O que planeja daqui a 3 anos?','http://191.232.161.50:8080/mapskills/images/scene01.jpg',1,26),(3,3,'Hum... Interessante! (O grupo conversa entre si) Você é exatamente o tipo de pessoa que precisamos no momento. O cargo de Gerente é seu. Você pode começar amanhã mesmo.','http://191.232.161.50:8080/mapskills/images/scene01.jpg',1,NULL),(4,4,'Bom dia, você deve ser o novo gerente. Estamos com um problema. Nossas receitas não estão agradando muitos clientes, precisamos fazer algo.','http://191.232.161.50:8080/mapskills/images/scene03.jpg',1,NULL),(5,5,'Você tem alguma ideia de o que podemos fazer?','http://191.232.161.50:8080/mapskills/images/scene03.jpg',1,2),(6,6,'Realmente, isso deve resolver o problema.','http://191.232.161.50:8080/mapskills/images/scene03.jpg',1,NULL),(7,7,'Mas também precisaremos comprar mais ingredientes, e temos um pequeno problema com isso também. A verba não está muito grande e precisamos fazer algo.','http://191.232.161.50:8080/mapskills/images/scene04.jpg',1,NULL),(8,8,'Estes são os fornecedores disponíveis. o que deseja fazer?','http://191.232.161.50:8080/mapskills/images/scene04.jpg',1,3),(9,9,'Ok, já liguei para estes, pela manhã os ingredientes devem chegar.','http://191.232.161.50:8080/mapskills/images/scene04.jpg',1,NULL),(10,10,'Parece que as pizzas voltaram a vender como antes, mas nossa equipe de atendentes é muito inexperiente.','http://191.232.161.50:8080/mapskills/images/scene05.jpg',1,NULL),(11,11,'O que planeja fazer a respeito?','http://191.232.161.50:8080/mapskills/images/scene06.jpg',1,4),(12,12,'OK. Vamos por em prática imediatamente.','http://191.232.161.50:8080/mapskills/images/scene06.jpg',1,NULL),(13,13,'Parece que temos um probleminha com as entregas. Elas estão chegando muito atrasadas.','http://191.232.161.50:8080/mapskills/images/scene07.jpg',1,NULL),(14,14,'Mas é por culpa dessa moto que fica dando problema toda hora! Temos que dar um jeito nisso.','http://191.232.161.50:8080/mapskills/images/scene07.jpg',1,5),(15,15,'Opa! Beleza, isso deve ajudar muito. Daqui a pouco eu volto, tenho entregas a fazer!','http://191.232.161.50:8080/mapskills/images/scene07.jpg',1,NULL),(16,16,'(Você vê um funcionário dormindo durante o expediente.)','http://191.232.161.50:8080/mapskills/images/scene08.jpg',1,NULL),(17,17,'(Você vê um funcionário dormindo durante o expediente.)','http://191.232.161.50:8080/mapskills/images/scene08.jpg',1,27),(18,18,'Hein?!... Me desculpe chefe.','http://191.232.161.50:8080/mapskills/images/scene09.jpg',1,NULL),(19,19,'Hey! Esta vendo o que ta acontecendo? Parece que a crise econômica está bem complicada. Isso é ruim para os negócios, crise significa menos clientes. E agora?','http://191.232.161.50:8080/mapskills/images/scene10.jpg',1,NULL),(20,20,'Chefe! Não vimos você por aqui, o conselho superior ligou alertando sobre a crise. Querem que você tome alguma atitude preventiva.','http://191.232.161.50:8080/mapskills/images/scene11.jpg',1,7),(21,21,'Imediatamente!','http://191.232.161.50:8080/mapskills/images/scene11.jpg',1,NULL),(22,22,'QUE PORCARIA, É ESSA!? Eu não vou comer isso aqui! Mas senhor, é exatamente o que você pediu.','http://191.232.161.50:8080/mapskills/images/scene12.jpg',1,NULL),(23,23,'(O que fazer?)','http://191.232.161.50:8080/mapskills/images/scene12.jpg',1,8),(24,24,'EU QUERO FALAR COM O GERENTE! AGORA!','http://191.232.161.50:8080/mapskills/images/scene12.jpg',1,NULL),(25,25,'AI ESTÁ VOCÊ!! PODE ME DIZER O QUE É ISSO?ISSO NÃO É MUÇARELA! A VERDADEIRA MUÇARELA DE BÚFALA NÃO SE COMPARA COM ESTA PORCARIA NÃO VOU PAGAR POR UMA PIZZA HORRÍVEL DESSAS.','http://191.232.161.50:8080/mapskills/images/scene13.jpg',1,NULL),(26,26,'TENTE SABOREAR UM POUCO ESTA PORCARIA. Eae? Gostou?','http://191.232.161.50:8080/mapskills/images/scene14.jpg',1,9),(27,27,'Humpf... Estou vendo que não vai sair nada de bom daqui, eu vou embora.','http://191.232.161.50:8080/mapskills/images/scene14.jpg',1,NULL),(28,28,'Os investimentos recentes não estão dando retorno, e ainda por cima, as despesas têm aumentado.','http://191.232.161.50:8080/mapskills/images/scene15.jpg',1,NULL),(29,29,'Tem certeza que é uma boa ideia manter o projeto em andamento?','http://191.232.161.50:8080/mapskills/images/scene15.jpg',1,10),(30,30,'Certo.','http://191.232.161.50:8080/mapskills/images/scene15.jpg',1,NULL),(31,31,'Olá chefe. Sabe estive pensando um pouco e meio que... Estou precisando de um aumento.','http://191.232.161.50:8080/mapskills/images/scene16.jpg',1,NULL),(32,32,'Será que é possivel?','http://191.232.161.50:8080/mapskills/images/scene16.jpg',1,11),(33,33,'Entendo, desculpe por te incomodar.','http://191.232.161.50:8080/mapskills/images/scene16.jpg',1,NULL),(34,34,'Hey chefe, A demanda está muito grande! Os ingredientes estão acabando!','http://191.232.161.50:8080/mapskills/images/scene18.jpg',1,NULL),(35,35,'O que faremos?!','http://191.232.161.50:8080/mapskills/images/scene18.jpg',1,12),(36,36,'Uffa, essa foi por pouco hein.','http://191.232.161.50:8080/mapskills/images/scene18.jpg',1,NULL),(37,37,'Parece que abriu uma nova pizzaria na vizinhança? Talvez seja por isso que as vendas tem caído.','http://191.232.161.50:8080/mapskills/images/scene19.jpg',1,NULL),(38,38,'Se não fizermos nada, pode ser que eles comprometam nosso crescimento. Tem algum plano?','http://191.232.161.50:8080/mapskills/images/scene19.jpg',1,28),(39,39,'Está certo! Vamos mostrar do que somos capazes!','http://191.232.161.50:8080/mapskills/images/scene19.jpg',1,NULL),(40,40,'Os clientes estão voltando. A demanda está maior do que nunca, mas agora são muitos pedidos de entrega, e durante os horários de pico, não estamos dando conta.','http://191.232.161.50:8080/mapskills/images/scene20.jpg',1,NULL),(41,41,'(A necessidade de mais funcionários é inegável, mas quando fazer as entrevistas?)','http://191.232.161.50:8080/mapskills/images/scene20.jpg',1,14),(42,42,'Certo, colocarei avisos pela cidade. (A nova equipe começara o mais rápido possível)','http://191.232.161.50:8080/mapskills/images/scene20.jpg',1,NULL),(43,43,'Nunca imaginei que diria isso, mas nosso estoque está pequeno demais para suportar a quantidade de ingredientes que usamos semanalmente.','http://191.232.161.50:8080/mapskills/images/scene22.jpg',1,NULL),(44,44,'Vamos deixar do jeito que está? Ou faremos alguma modificação local?','http://191.232.161.50:8080/mapskills/images/scene22.jpg',1,15),(45,45,'Vamos ver o que podemos fazer então.','http://191.232.161.50:8080/mapskills/images/scene22.jpg',1,NULL),(46,46,'Mas o que vamos fazer com esse excesso de igredientes que temos no momento?','http://191.232.161.50:8080/mapskills/images/scene22.jpg',1,NULL),(47,47,'Eles vão perecer logo.','http://191.232.161.50:8080/mapskills/images/scene22.jpg',1,16),(48,48,'E não é que é uma ótima ideia!','http://191.232.161.50:8080/mapskills/images/scene22.jpg',1,NULL),(49,49,'Ouvimos muita coisa da... (Celular toca com o número de emergência.) Pode atender.','http://191.232.161.50:8080/mapskills/images/scene01.jpg',1,NULL),(50,50,'(Atende) TEMOS UM PROBLEMA SÉRIO, ACABAMOS DE SER ASSALTADOS. O pessoal está em choque, o que devemos fazer agora?','http://191.232.161.50:8080/mapskills/images/scene23.jpg',1,29),(51,51,'Certo! Remarcaremos a reunião para uma data futura. Deixe o relatório e discutiremos sobre ele na próxima reunião.','http://191.232.161.50:8080/mapskills/images/scene23.jpg',1,NULL),(52,52,'(Chegando no serviço, você vê o local bem destruído e a equipe toda de cabeça baixa.) Eis que aparece um Policial: Jovem, me disseram que é a pessoa responsável por este local. Estamos fazendo tudo o possível para achar o ladrão.','http://191.232.161.50:8080/mapskills/images/scene24.jpg',1,NULL),(53,53,'Mas aconcelhamos aumentar a segurança do local.','http://191.232.161.50:8080/mapskills/images/scene25.jpg',1,18),(54,54,'Certo! Vamos te atualizar sobre o caso assim que possível.','http://191.232.161.50:8080/mapskills/images/scene24.jpg',1,NULL),(55,55,'Olá, sou reporter do Jornal X. Já conversei com seus funcionários, mas será que poderia me responder uma pergunta?','http://191.232.161.50:8080/mapskills/images/scene26.jpg',1,NULL),(56,56,'A sua pizzaria se tornou a mais popular na região. Mas você acha que o incidente pode acarretar algum problema para os negócios?','http://191.232.161.50:8080/mapskills/images/scene26.jpg',1,32),(57,57,'Muito obrigado pela breve entrevista, retornarei em breve.','http://191.232.161.50:8080/mapskills/images/scene26.jpg',1,NULL),(58,58,'Aproveitando a destruição, o estabelecimento terá uma reconstrução.','http://191.232.161.50:8080/mapskills/images/scene27.jpg',1,NULL),(59,59,'Que mensegem deixaremos para os clientes até que voltemos?','http://191.232.161.50:8080/mapskills/images/scene27.jpg',1,20),(60,60,'Pronto! Já está tudo em ordem','http://191.232.161.50:8080/mapskills/images/scene27.jpg',1,NULL),(61,61,'(Você recebe a informação de que o ladrão foi preso.) Mas ao voltar o funcionamento da pizzaria, você percebe que a equipe não está muito animada.','http://191.232.161.50:8080/mapskills/images/scene28.jpg',1,NULL),(62,62,'(Como evitar o desânimo geral?)','http://191.232.161.50:8080/mapskills/images/scene28.jpg',1,30),(63,63,'A equipe entende seu esforço, e tenta melhorar o humor.','http://191.232.161.50:8080/mapskills/images/scene28.jpg',1,NULL),(64,64,'O atendente que estava sendo feito de refém durante o assalto não está tendo um bom rendimento.','http://191.232.161.50:8080/mapskills/images/scene01.jpg',1,NULL),(65,65,'Ao ver esta situação, você...','http://191.232.161.50:8080/mapskills/images/scene01.jpg',1,22),(66,66,'Obrigado. (O atendente muda sua postura.  e em alguns dias ele) Desculpe!, Vou me concentrar mais.','http://191.232.161.50:8080/mapskills/images/scene01.jpg',1,NULL),(67,67,'Parabéns! Sua filial foi considerada a de maior rendimento neste mês, mesmo com os contratempos apresentados. Mas lembre-se, seu contrato acaba no final do mês que vem.','http://191.232.161.50:8080/mapskills/images/scene01.jpg',1,NULL),(68,68,'Estamos aumentando o seu orçamento para que faça os preparativos. Use bem estes recursos.','http://191.232.161.50:8080/mapskills/images/scene01.jpg',1,23),(69,69,'Aguardaremos o relatório no final do período.','http://191.232.161.50:8080/mapskills/images/scene01.jpg',1,NULL),(70,70,'Está preocupado com alguma coisa? Você não parece estar muito bem.','http://191.232.161.50:8080/mapskills/images/scene20.jpg',1,NULL),(71,71,'(Ninguém está ciente de sua saída) Precisa de alguma coisa?','http://191.232.161.50:8080/mapskills/images/scene20.jpg',1,31),(72,72,'Pode contar conosco sempre que precisar. Afinal somos amigos.','http://191.232.161.50:8080/mapskills/images/scene20.jpg',1,NULL),(73,73,'Bom dia. Parece que hoje é o dia da sucessão.','http://191.232.161.50:8080/mapskills/images/scene01.jpg',1,NULL),(74,74,'Quais foram as dificuldades enfrentadas durante estes 6 meses?','http://191.232.161.50:8080/mapskills/images/scene01.jpg',1,25),(75,75,'Foi bom trabalhar contigo! Obrigado por seus serviços.','http://191.232.161.50:8080/mapskills/images/scene01.jpg',1,NULL),(76,0,'Você foi selecionado para uma entrevista de emprego, para uma vaga temporária de gerente numa filial de uma franquia de pizzarias. Boa Sorte!!','http://191.232.161.50:8080/mapskills/images/scene00.jpg',1,NULL);
